import React from 'react'

// 
const Page = () => {
  return (
    <div className='k-social-index-page'>
        <div class="social social-index-banner"></div>
        <div className="social-index-filters">
        <div className="k-common-filters"></div>
        <div className="k-common-filters-items-row"></div>
        </div>
        <div className="social-index-search"></div>
        <div className="social-index-table"></div>
    </div>
  )
}

export default Page
